import React, { useState } from "react";

export default function ProgressBar(props) {
  const [state, setState] = useState({ percentage: 0 });
  const filler = props => <div className="bg-red-600 h-full" />;
  return (
    <div className="relative h-4 w-3/4 border border-solid border-black rounded-lg">
      {filler}
    </div>
  );
}
